import React from 'react';

function ReportsPage() {
    return (
        <div>
            <h2>Reports</h2>
            <p>Generate detailed reports on trade performance, including metrics like profit/loss, win rate, average return, and performance by strategy.</p>
        </div>
    );
}

export default ReportsPage;
